function Effect(img){
	this.initialize(img);
}

Effect.prototype = new createjs.BitmapAnimation();
Effect.prototype.BitmapAnimation_initialize = Effect.prototype.initialize;
Effect.prototype.destroy = false;
Effect.prototype.initialize = function(img){
	var localSpriteSheet = new createjs.SpriteSheet({
		images:[img],
		frames:{width:60, height:60, regX:30, regY:45},
		animations:{
			default:{frames:[0,1,2], frequency:5}
		}
	});
	this.BitmapAnimation_initialize(localSpriteSheet);
	this.play();
}

Effect.prototype.play = function(){
	this.gotoAndPlay("default");
	this.onAnimationEnd = function(){
		this.destroy = true;
	}
}
